import { Route, Routes } from 'react-router-dom';
import CalculatorForm from './components/CalculatorForm'; // Import your form component
import ResultPage from './Pages/ResultPage'; // Import your result page component

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<CalculatorForm />} />
        <Route path="/result" element={<ResultPage />} />
      </Routes>
    </div>
  );
}

export default App;
